A TreeVisitor that visits all the child tree nodes. To visit nodes of a particular type, just override the corresponding visitXYZ method. Inside your method, call super.visitXYZ to visit descendant nodes. 
<p>The default implementation of the visitXYZ methods will determine a result as follows: </p>
<ul> 
 <li>If the node being visited has no children, the result will be <code>null</code>. </li>
 <li>If the node being visited has one child, the result will be the result of calling <code>scan</code> on that child. The child may be a simple node or itself a list of nodes. </li>
 <li> If the node being visited has more than one child, the result will be determined by calling <code>scan</code> each child in turn, and then combining the result of each scan after the first with the cumulative result so far, as determined by the <a href="#reduce(R,R)"><code>reduce(R, R)</code></a> method. Each child may be either a simple node of a list of nodes. The default behavior of the <code>reduce</code> method is such that the result of the visitXYZ method will be the result of the last child scanned. </li>
</ul> 
<p></p>
<p>Here is an example to count the number of identifier nodes in a tree: </p>
<pre>   class CountIdentifiers extends TreeScanner&lt;Integer,Void&gt; {
      @Override
      public Integer visitIdentifier(IdentifierTree node, Void p) {
          return 1;
      }
      @Override
      public Integer reduce(Integer r1, Integer r2) {
          return (r1 == null ? 0 : r1) + (r2 == null ? 0 : r2);
      }
   }
 </pre>
